import React from 'react';
import './AddItem.css';

export default class AddItem extends React.Component
{
	render()
	{
		const {onAdded} = this.props;
		return(
			<div className="additem">
				<button className="btn btn-outline-secondary" onClick={onAdded}>
					Add Item
				</button>
			</div>
		);
	}
}
